const AddItem=()=>{
    return <div className="container"> <form className="form-group">
        <input type="number" placeholder="id" className="form-control"></input><br></br>
        <input type="text" placeholder="name" className="form-control"></input><br></br>
        <input type="number" placeholder="price" className="form-control"></input><br></br>
        <input type="text" placeholder="pic" className="form-control"></input><br></br>
    </form></div>
}
export default  AddItem;
